import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Link = props => {
  return (
    <Button color="none" className="button-link">
      <a href={props.url} onClick={handleClick}>
        <img src={props.image}></img>
        <p>{props.text}</p>
      </a>
    </Button>
  );
};

export default Link;
